/// data : [{"id":2,"tag_id":1,"image":"posts/4-1629519400.jpg","title":"الطائف احلى","content":"مدينة الطائف الطائف مدينةٌ عربيةٌ من مدن المملكة العربية السعودية، تعود بتأسيسها إلى ما قبل ميلاد سيدنا عيسى بن مريم عليهما السلام، وتقع جغرافياً في الجهة الغربية من المملكة العربية السعودية وتحديداً في مدينة مكة المكرمة، وتقع فلكياً بين خطي طول 40 درجةً إلى 42 درجةً شرق خط جرينتش، وبين دائرتي عرض 20 درجةً إلى 22 درجةً شمال خط الاستواء، وتبلغ مساحة أراضيها 87.561 كم² ، وتحتل المرتبة السادسة من بين مدن السعودية من حيث عدد السكان؛ إذ بلغ عدد سكانها 993.800 نسمة وذلك حسب إحصائيات عام 2014م، ويتحدث سكانها اللغة العربية التي تعتبر لغةً رسمية في السعودية، ويدين سكانها بالدين الإسلامي.[١] معلومات عن مدينة الطائف فيما يلي معلومات عن المدينة:[٢] يقام على أرضها سنوياً العديد من المهرجانات كمهرجان قطاف الورد الطائفي، ومهرجان الهدا، ومهرجان سباقات الهجن السنوية، ومهرجان صيف الطائف، ومهرجان الطائف الشتوي، ومهرجان ربيع البهيتة. تحدث عنها الإصطخري في كتابه بأنّها: الطائف مدينة أكثر ثمارها الزبيب، وهي طيبة الهواء، وأكثر فواكه مكة منها. تشتهر المدينة بأنّها أول مدينةٍ أقيم فيها تخطيطٌ هندسيٌ، وأول مدينةٍ يقصدها الرسول صلى الله عليه وسلم، وأول مدينة في السعودية هبطت فيها طائرة سعودية، وأول مدينةٍ بني فيها مدرسةٌ نظامية تهتمّ بالدراسات الإسلامية. يمتاز مناخها بأنّه باردٌ في فصل الشتاء، ومعتدل الحرارة في فصل الصيف. تمتلك الطائف محطاتٍ تاريخيةً متنوعة مرت عليها عبر العصور التاريخية، منها: عُقدت على أرضها معاهدة بين المملكة المتوكلية اليمنية والمملكة العربية السعودية وذلك في العام 1934م، وفيها أعلن عن نهاية الحرب السعودية اليمنية. أقيم فيها البطولة العربية لمنتخبات كرة القدم في العام 1986م، وقد استضافت البطولة العربية لألعاب القوى وكأس العالم للشباب في العام 1989م. شهدت المدينة جزءاً كبيراً من المؤتمر الإسلامي الذي عقد في محافظة مكة المكرمة في بداية عقد الثمانينات، وفي العام 1989م عقد فيها اتفاق صلحٍ بين جميع الفصائل اللبنانية في حرب لبنان عرفت باسم اتفاق الطائف.\r\n\r\n","created_at":"2021-07-02T05:49:23.000000Z","updated_at":"2021-09-02T15:47:40.000000Z","youtube":null,"views":43,"location_lng":null,"location_lat":null,"phone":null},{"id":4,"tag_id":1,"image":"posts/4-1629519653.jpg","title":"تراث الطائف","content":"مدينة الطائف الطائف مدينةٌ عربيةٌ من مدن المملكة العربية السعودية، تعود بتأسيسها إلى ما قبل ميلاد سيدنا عيسى بن مريم عليهما السلام، وتقع جغرافياً في الجهة الغربية من المملكة العربية السعودية وتحديداً في مدينة مكة المكرمة، وتقع فلكياً بين خطي طول 40 درجةً إلى 42 درجةً شرق خط جرينتش، وبين دائرتي عرض 20 درجةً إلى 22 درجةً شمال خط الاستواء، وتبلغ مساحة أراضيها 87.561 كم² ، وتحتل المرتبة السادسة من بين مدن السعودية من حيث عدد السكان؛ إذ بلغ عدد سكانها 993.800 نسمة وذلك حسب إحصائيات عام 2014م، ويتحدث سكانها اللغة العربية التي تعتبر لغةً رسمية في السعودية، ويدين سكانها بالدين الإسلامي.[١] معلومات عن مدينة الطائف فيما يلي معلومات عن المدينة:[٢] يقام على أرضها سنوياً العديد من المهرجانات كمهرجان قطاف الورد الطائفي، ومهرجان الهدا، ومهرجان سباقات الهجن السنوية، ومهرجان صيف الطائف، ومهرجان الطائف الشتوي، ومهرجان ربيع البهيتة. تحدث عنها الإصطخري في كتابه بأنّها: الطائف مدينة أكثر ثمارها الزبيب، وهي طيبة الهواء، وأكثر فواكه مكة منها. تشتهر المدينة بأنّها أول مدينةٍ أقيم فيها تخطيطٌ هندسيٌ، وأول مدينةٍ يقصدها الرسول صلى الله عليه وسلم، وأول مدينة في السعودية هبطت فيها طائرة سعودية، وأول مدينةٍ بني فيها مدرسةٌ نظامية تهتمّ بالدراسات الإسلامية. يمتاز مناخها بأنّه باردٌ في فصل الشتاء، ومعتدل الحرارة في فصل الصيف. تمتلك الطائف محطاتٍ تاريخيةً متنوعة مرت عليها عبر العصور التاريخية، منها: عُقدت على أرضها معاهدة بين المملكة المتوكلية اليمنية والمملكة العربية السعودية وذلك في العام 1934م، وفيها أعلن عن نهاية الحرب السعودية اليمنية. أقيم فيها البطولة العربية لمنتخبات كرة القدم في العام 1986م، وقد استضافت البطولة العربية لألعاب القوى وكأس العالم للشباب في العام 1989م. شهدت المدينة جزءاً كبيراً من المؤتمر الإسلامي الذي عقد في محافظة مكة المكرمة في بداية عقد الثمانينات، وفي العام 1989م عقد فيها اتفاق صلحٍ بين جميع الفصائل اللبنانية في حرب لبنان عرفت باسم اتفاق الطائف.\r\n\r\n","created_at":"2021-07-02T05:49:23.000000Z","updated_at":"2021-09-02T15:35:31.000000Z","youtube":null,"views":22,"location_lng":null,"location_lat":null,"phone":null},{"id":5,"tag_id":1,"image":"posts/4-1629519239.jpg","title":"السحاب يعانق الطائف","content":"مدينة الطائف الطائف مدينةٌ عربيةٌ من مدن المملكة العربية السعودية، تعود بتأسيسها إلى ما قبل ميلاد سيدنا عيسى بن مريم عليهما السلام، وتقع جغرافياً في الجهة الغربية من المملكة العربية السعودية وتحديداً في مدينة مكة المكرمة، وتقع فلكياً بين خطي طول 40 درجةً إلى 42 درجةً شرق خط جرينتش، وبين دائرتي عرض 20 درجةً إلى 22 درجةً شمال خط الاستواء، وتبلغ مساحة أراضيها 87.561 كم² ، وتحتل المرتبة السادسة من بين مدن السعودية من حيث عدد السكان؛ إذ بلغ عدد سكانها 993.800 نسمة وذلك حسب إحصائيات عام 2014م، ويتحدث سكانها اللغة العربية التي تعتبر لغةً رسمية في السعودية، ويدين سكانها بالدين الإسلامي.[١] معلومات عن مدينة الطائف فيما يلي معلومات عن المدينة:[٢] يقام على أرضها سنوياً العديد من المهرجانات كمهرجان قطاف الورد الطائفي، ومهرجان الهدا، ومهرجان سباقات الهجن السنوية، ومهرجان صيف الطائف، ومهرجان الطائف الشتوي، ومهرجان ربيع البهيتة. تحدث عنها الإصطخري في كتابه بأنّها: الطائف مدينة أكثر ثمارها الزبيب، وهي طيبة الهواء، وأكثر فواكه مكة منها. تشتهر المدينة بأنّها أول مدينةٍ أقيم فيها تخطيطٌ هندسيٌ، وأول مدينةٍ يقصدها الرسول صلى الله عليه وسلم، وأول مدينة في السعودية هبطت فيها طائرة سعودية، وأول مدينةٍ بني فيها مدرسةٌ نظامية تهتمّ بالدراسات الإسلامية. يمتاز مناخها بأنّه باردٌ في فصل الشتاء، ومعتدل الحرارة في فصل الصيف. تمتلك الطائف محطاتٍ تاريخيةً متنوعة مرت عليها عبر العصور التاريخية، منها: عُقدت على أرضها معاهدة بين المملكة المتوكلية اليمنية والمملكة العربية السعودية وذلك في العام 1934م، وفيها أعلن عن نهاية الحرب السعودية اليمنية. أقيم فيها البطولة العربية لمنتخبات كرة القدم في العام 1986م، وقد استضافت البطولة العربية لألعاب القوى وكأس العالم للشباب في العام 1989م. شهدت المدينة جزءاً كبيراً من المؤتمر الإسلامي الذي عقد في محافظة مكة المكرمة في بداية عقد الثمانينات، وفي العام 1989م عقد فيها اتفاق صلحٍ بين جميع الفصائل اللبنانية في حرب لبنان عرفت باسم اتفاق الطائف.\r\n\r\n","created_at":"2021-07-02T05:49:23.000000Z","update