class TaifModel {
  bool? _status;
  int? _code;
  List<TaifData>? _data;

  bool? get status => _status;
  int? get code => _code;
  List<TaifData>? get data => _data;

  TaifModel({
      bool? status, 
      int? code, 
      List<TaifData>? data}){
    _status = status;
    _code = code;
    _data = data;
}

  TaifModel.fromJson(dynamic json) {
    _status = json['status'];
    _code = json['code'];
    if (json['data'] != null) {
      _data = [];
      json['data'].forEach((v) {
        _data?.add(TaifData.fromJson(v));
